import React from 'react'
import top from './top.css';
function Top() {
    return (
        <div className='top'>
            <div className='top-main'>
            <div className='f'>
              <p>the</p>
            </div>
            <div sec='s'>
                <p>Siren</p>
            </div>
           </div>
           <div className='getstart'> 
              <p>Get Started</p>
           </div>
        </div>
    )
}

export default Top;
